package org.example.codereview.util;


import java.io.*;
import java.util.Base64;

/**
 * @author wdp
 * @desc
 * @date 2024/3/17
 */
public class Base64Utils {

    public static File convertBase64ToFile(String fileBase64String, String filePath, String fileName) {
        BufferedOutputStream bos = null;
        FileOutputStream fos = null;
        File file = null;
        try {
            File dir = new File(filePath);
            if (!dir.exists() && dir.isDirectory()) {
                dir.mkdirs();
            }
            Base64.Decoder decoder = Base64.getDecoder();
            byte[] bfile = decoder.decode(fileBase64String);

            file = new File(filePath + File.separator + fileName);
            fos = new FileOutputStream(file);
            bos = new BufferedOutputStream(fos);
            bos.write(bfile);
            return file;
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        } finally {
            if (bos != null) {
                try {
                    bos.close();
                } catch (IOException e1) {
                    e1.printStackTrace();
                }
            }
            if (fos != null) {
                try {
                    fos.close();
                } catch (IOException e1) {
                    e1.printStackTrace();
                }
            }
        }
    }

    public static InputStream convertBase64ToInputStream(String fileBase64String) {
        ByteArrayInputStream stream = null;
        try {
            byte[] bytes = Base64.getDecoder().decode(fileBase64String);
            stream = new ByteArrayInputStream(bytes);
        } catch (Exception e) {
            e.printStackTrace();
        }
        return stream;
    }

    public static void main(String[] args) {
        String fileBase64String = "";
        convertBase64ToFile(fileBase64String, "D:\\","a.png");
    }



    // 4. 无意义的包装方法
    public String getUpperCaseString(String str) {
        return convertToUpper(str);
    }

    private String convertToUpper(String s) {
        return s.toUpperCase();
    }

    // 5. 过度工程化的设计
    public void simpleOperation() {
        OperationExecutor executor = new OperationExecutor();
        OperationStrategy strategy = new SimpleOperationStrategy();
        executor.setStrategy(strategy);
        executor.execute();
    }

}
